import { Table } from "react-bootstrap";
import data from "./events_data";

const MyEvents = () => {
  const myEvents = data.filter((eve) => eve.registered === true);
  console.log(myEvents);

  return (

    <Table striped bordered hover>
      <thead>
        <tr>
          <th>#</th>
          <th>Event Name</th>
          <th>Organiser</th>
          <th>Date</th>
          <th>Location</th>
        </tr>
      </thead>

      <tbody>
        {myEvents.map((eve) => {
          <tr>
            <td>{eve.id}</td>
            <td>{eve.name}</td>
            <td>{eve.date}</td>
            <td>{eve.location}</td>
          </tr>;
        })}
      </tbody>
    </Table>
  );
};

export default MyEvents;
